As the root database user, we create a new database for the user account we just created. We'll call this database opacdb and set the character encoding to UTF-8 to support international characters. Then we run the MySQL show command to view the new database. Next we grant all privileges on the database to the user account opacuser. mysql> create database opacdb default character set utf8mb4 collate utf8mb4_unicode_ci;
mysql> show databases;
mysql> grant all privileges on opacdb.* to 'opacuser'@'localhost' with grant option; Other than granting all privileges , we could limit the user to specific privileges, including: CREATE DROP DELETE INSERT SELECT UPDATE GRANT OPTION Such privileges may be called operations or functions. They allow MySQL users to use and modify the databases, where appropriate. For example, we may want to limit the opacuser user account to only be able to use SELECT commands. These decisions depend on the purpose of the database and our security risks. Exit out of the MySQL database as the root MySQL user , and then exit out of the root Linux user account . You should be back to your normal Linux user account: mysql> \q Note: relational database keywords are often written in all capital letters: CREATE, DROP, SELECT, etc. As far as I know, this is simply a convention to make the code more readable. However, in most cases I'll write the keywords in lower case letters. This is simply because, by convention, I'm lazy .

