We can now start doing MySQL work. Note that when we login to the MySQL server, we leave the bash shell and enter the MySQL command line client. By default, the prompt for the client is bare-bones. We can make it more informative, though. To do so, open your .bashrc file: nano .bashrc Scroll to the bottom of the file and add the following: export MYSQL_PS1="[\d]> " Then save and exit and source the file: source ~/.bashrc As a reminder, we've created a new MySQL user named opacuser and a new database for opacuser that is called opacdb. When we run the show databases command as the opacuser user, we should see the opacdb database. Note below that I use the -p option when logging back into MySQL as the opacuser. This instructs MySQL to request the password for this user, it is required. mysql -u opacuser -p From the MySQL prompt, list the available databases and use the use command to switch to the new opacdb database: mysql> show databases;
mysql> use opacdb; A database is not worth much without data. In the following code, I create and define a new table for our opacdb database. The table will be called books that will contain data describing, er, some books. We will keep this table very simple and use only four fields: id, author, title, and copyright. The id field will function as a primary key (second to last line in the command below). This key is used as a unique identifier for a record in the field. When we create this key as a field called id, we state that it should be an integer id (or whole number), that it should only be a positive number unsigned, that it should not be empty not null, and that with each record, it should increment by a single integer auto_increment. When we create the author and title fields, we say that these fields can have a maximum length of 150 characters and should not be empty. When we create the copyright field, we limit it to the year data type, which means it has to adhere to a specific syntax YYYY, and should not be empty. mysql> create table books ( id int unsigned not null auto_increment, author varchar(150) not null, title varchar(150) not null, copyright year(4) not null, primary key (ID)
); Note: A relational database contains tables. If you are unfamiliar with this, you can think of a database as an overall Excel spreadsheet file and tables as specific sheets in the Excel file. There is quite a bit that goes into creating proper tables in database because the composition dictates how well data is described and how tables connect and interact with (or relate to ) each other. However, we are going to keep things rather simple in this exercise. You can confirm that the table was created by running the following two commands. The MySQL show command lists the tables in a database and the describe command describes a table's structure. mysql> show tables;
mysql> describe books; Congratulations! Now create some records for that table.

