We will complete the following tasks to refresh our MySQL knowledge or begin to learn how it works. We will: retrieve records or parts of records, delete a record, alter the table structure so that it will hold more data, and add a record Note: each MySQL command ends with a semi-colon. Some of the following MySQL commands are single-line, but others are multi-line. Regardless if a MySQL command is one-line or multi-line, it doesn't end until it ends with a semi-colon. Please run the following commands, one at a time: mysql> select author from books;
mysql> select copyright from books;
mysql> select author, title from books;
mysql> select author from books where author like '%millet%';
mysql> select title from books where author like '%mbue%';
mysql> select author, title from books where title not like '%e';
mysql> select * from books;
mysql> alter table books add publisher varchar(75) after title;
mysql> describe books;
mysql> update books set publisher='Simon \& Schuster' where id='1';
mysql> update books set publisher='Penguin Random House' where id='2';
mysql> update books set publisher='W. W. Norton \& Company' where id='3';
mysql> update books set publisher='Knopf' where id='4';
mysql> select * from books;
mysql> delete from books where author='Julia Phillips';
mysql> insert into books (author, title, publisher, copyright) values ('Emma Donoghue', 'Room', 'Little, Brown \& Company', '2010'), ('Zadie Smith', 'White Teeth', 'Hamish Hamilton', '2000');
mysql> select * from books;
mysql> select author, publisher from books where copyright < '2011';
mysql> select author from books order by copyright;
